import { createUseStyles } from 'react-jss';
import { BUTTON_PRIMARY, LINK_PRIMARY } from '../Styles/Button';

const Styles = createUseStyles({
  navbar: {
    paddingTop: '20px',
    paddingBottom: '20px',
    '@media screen and (min-width: 992px)': {
      '& .button-primary': BUTTON_PRIMARY,
      '& .link-primary': LINK_PRIMARY,
    },
    '& .navbar-toggler': {
      color: '#718096',
      border: 0,
    },
    '& .message': {
      '& .icon': {
        color: '#a0aec0',
        fontSize: '20px',
        '&:hover': {
          color: '#718096',
        },
      },
    },
    '& .dropdown-item': {
      '& .icon': {
        color: '#4a5568',
        minWidth: '20px',
      },
    },
    '& .dropdown': {
      '& .dropdown-toggle::after': {
        display: 'none',
      },
      '& .user-menu': {
        color: '#2d3748',
        '&:hover': {
          color: '#1a202c',
        },
      },
    },
    '& .logo': {
      height: '75px',
      marginBottom: '25px',
    },
  },
});

export default Styles;
